import React, { useEffect, useState } from "react";
import axios from "axios";



const Result = () => {
  const [post, setPost] = useState(null);
  axios({
    method: 'GET',
    url: 'http://localhost:8800/63a2bd007185dee476073e12',
     
  }).then(response => {
      setPost(response.data);
    }, (error) => {
    console.log(error);
  });
  console.log(post)
  return (
    <div>
      <h1>{post.text}</h1>
    </div>
  )
}


export default Result;
